
-- ===========   Initialization  =============
drop table if exists project_comment;
drop table if exists project_article;
drop table if exists project_user;

create table project_user (
    user_Id int not null auto_increment,

    user_Name varchar(50) not null unique,

    user_Contact varchar(15),
    user_Email text,
    user_City varchar(32),
    user_Country varchar(64),

    user_fname text,
    user_lname text,

    -- Using 'YYYY-MM-DD' format to store date, which is compatible with
    -- both UserDAO and parsing value from the input in JSP
    user_DOB date,
    user_description text,

    avatar_Url text,
    -- Password information
    -- Hash Code fixed length must be 88 characters
    user_hashCode char(88),
    -- Default salt size is 8, encode by base64 to store in database, the length of the salt string is fixed, must be 12 characters
    user_salt char(12),
    -- Default iteration is 100000
    user_iteration int,

    primary key (user_Id)
);

create table if not exists project_article(

    article_Id int not null auto_increment,
    -- User write the article
    user_Id int not null,

    article_title text,
    article_keyword text,
    article_abstract text,
    article_postTime timestamp,
    article_content text,

    primary key (article_Id),
    foreign key (user_Id) references project_user (user_Id) on delete cascade
);

create table if not exists project_comment(
    comment_Id int not null auto_increment,
    -- Assume all comment begin with no parent comment
    -- Will not update parentID if its not a nested comment, set default to null

--     parent_Id int not null default 0,
    article_Id int not null ,
    -- User write the comment
    user_Id int not null,

    parent_Id int default null,

    comment_title text,
    comment_postTime timestamp,
    comment_content text,

    primary key (comment_Id),
    foreign key (article_Id) references project_article (article_Id) on delete cascade,
    foreign key (user_Id) references project_user (user_Id) on delete cascade,

    -- Reference the comment ID in the same table. If the user is deleted, its comment will also be deleted. Nest comments
    -- that are associated to that comment ID (parent ID = comment ID) will also be deleted. But the remaining comments
    -- will be intact.
    foreign key (parent_Id) references project_comment (comment_Id) on delete cascade
);




